using System;
using System.Collections.Generic;
using System.Drawing;
using System.Windows.Forms;

namespace FractalDraw
{
    public partial class Form1
    {
        class KochCurve : Fractal
        {
            double atan2;
            // Variable is explained by the function it is set with. 
            List<Color> gradientList = new List<Color>();
            /// <summary>
            /// Parse all data and draws curve based on it. 
            /// </summary>
            /// <param name="form"></param>
            /// <returns></returns>
            public override Bitmap FractalDraw(FractalDraw.Form1 form)
            {
                // We set beckground to white from transperent.
                using (var graphics = Graphics.FromImage(img))
                {
                    graphics.Clear(Color.White);
                }
                // Parses input from textboxes.
                int recLimit;
                if (!int.TryParse(form.textBoxRecDepth.Text, out recLimit) || recLimit <= 1 || recLimit > 10)
                {
                    string error;
                    error = "Incorrect recursion depth. ";
                    error += "You should enter integer in [2;10]. The default value 5 is set.";
                    MessageBox.Show(error);
                    recLimit = 5;
                    form.textBoxRecDepth.Text = "5";
                }

                GetGradientColorsToList(form, recLimit, gradientList);
                form.pictureBoxFractalDraw.Image = img;
                int[] arrayForPainting = Array.ConvertAll(unparsedNumbersForLinePaint[recLimit - 2].Split(' '), int.Parse);
                initAndDrawKochCurve(form, recLimit, arrayForPainting);
                
                form.pictureBoxFractalDraw.Refresh();
                return img;
            }
            /// <summary>
            /// Inits drawing of the curve.
            /// </summary>
            /// <param name="form"></param>
            /// <param name="recLimit"></param>
            /// <param name="arrayForPainting"></param>
            private void initAndDrawKochCurve(FractalDraw.Form1 form, int recLimit, int[] arrayForPainting)
            {
                // Sets the angles of segment rotation.
                double[] anglesForRotation = { 0, -Math.PI / 3, 2 * Math.PI / 3, -Math.PI / 3 };
                // Segment scaling ratio.
                float segmentRatio = 1 / 3f;

                float height = 0.75f * (Math.Min(
                baseRes,
                baseRes) - 20);
                float width = (float)(height / Math.Sqrt(3.0) * 2);
                float y1 = (float)baseRes - 10 - height;
                float x1 = baseRes / 2 - width / 2;
                float x2 = x1 + width;

                
                // Edge points for curve.
                PointF p1 = new PointF(x1, y1);
                PointF p2 = new PointF(x2, y1);

                double dx = p2.X - p1.X;
                double dy = p2.Y - p1.Y;
                double length = (double)Math.Sqrt(dx * dx + dy * dy);
                atan2 = (double)Math.Atan2(dy, dx);
                int counter = 0;
                DrawKochCurve(form, 0, recLimit, ref p1, length, anglesForRotation, segmentRatio, arrayForPainting, ref counter);
                
            }
            /// <summary>
            /// Recursively draws curve. 
            /// </summary>
            /// <param name="form"></param>
            /// <param name="recDepth"></param>
            /// <param name="recLimit"></param>
            /// <param name="p1"></param>
            /// <param name="dist"></param>
            /// <param name="anglesForRotation"></param>
            /// <param name="segmentRatio"></param>
            /// <param name="arrayForPainting"></param>
            /// <param name="counter"></param>
            private void DrawKochCurve(FractalDraw.Form1 form, int recDepth, int recLimit, ref PointF p1,
                double dist, double[] anglesForRotation, float segmentRatio, int[] arrayForPainting, ref int counter)
            {
                // On the last iteration of every recursion root it draws line. Then sets start point for next line to end of just drawn.
                if (recDepth == recLimit - 1)
                {
                    PointF p2 = new PointF(
                        (float)(p1.X + dist * Math.Cos(atan2)),
                        (float)(p1.Y + dist * Math.Sin(atan2)));
                    try
                    {
                        using (Graphics graphics = Graphics.FromImage(img))
                        {
                            graphics.SmoothingMode = System.Drawing.Drawing2D.SmoothingMode.AntiAlias;
                            graphics.DrawLine(new Pen(gradientList[arrayForPainting[counter] - 1], 5), p1, p2);
                        }
                    }
                    catch(Exception)
                    {
                        
                    }

                    counter++;
                    p1 = p2;
                    return;
                }

                dist *= segmentRatio;
                for (int i = 0; i < anglesForRotation.Length; i++)
                {
                    // The program draws 1/3 of the line segment, turns -60 degrees, draws 1/3 of it, 
                    // turns 120 degrees, draws another 1/3, turns -60 degrees, and draws another 1/3.
                    atan2 += anglesForRotation[i];
                    DrawKochCurve(form, recDepth + 1, recLimit, ref p1, dist, anglesForRotation, segmentRatio, arrayForPainting, ref counter);
                    
                }
            }
            /// <summary>
            /// Each number in this constant - number of color in gradient that will be applied to 
            /// segment of koch curve with serial number == index of number in any line of this array, splitted by ' '.
            /// Number of string is connected with recursion depth.
            /// For example in first line there are 4 numbers 1, 2, 2, 1
            /// 1 - means that the first segment (if we look at a curve from left to right) will be drawn on the first iteration.
            /// 2 - means that the second segment will be drawn on second iteration.
            /// 2 - means that the third segment will be drawns on second iteration.
            /// 1 - the fourth will be drawn on first.
            /// </summary>
            readonly string[] unparsedNumbersForLinePaint = { "1 2 2 1",
                "1 3 3 1 2 3 3 2 2 3 3 2 1 3 3 1",
                "1 4 4 1 3 4 4 3 3 4 4 3 1 4 4 1 2 4 4 2 3 4 4 3 3 4 4 3 2 4 4 2 2 4 4 2 3 4 4 3 3 4 4 3 2 4 4 2 1 4 4 1 3 4 4 3 3 4 4 3 1 4 4 1",
                "1 5 5 1 4 5 5 4 4 5 5 4 1 5 5 1 3 5 5 3 4 5 5 4 4 5 5 4 3 5 5 3 3 5 5 3 4 5 5 4 4 5 5 4 3 5 5 3 1 5 5 1 4 5 5 4 4 5 5 4 1 5 5 1 2 5 5 2 4 5 5 4 4 5 5 4 2 5 5 2 3 5 5 3 4 5 5 4 4 5 5 4 3 5 5 3 3 5 5 3 4 5 5 4 4 5 5 4 3 5 5 3 2 5 5 2 4 5 5 4 4 5 5 4 2 5 5 2 2 5 5 2 4 5 5 4 4 5 5 4 2 5 5 2 3 5 5 3 4 5 5 4 4 5 5 4 3 5 5 3 3 5 5 3 4 5 5 4 4 5 5 4 3 5 5 3 2 5 5 2 4 5 5 4 4 5 5 4 2 5 5 2 1 5 5 1 4 5 5 4 4 5 5 4 1 5 5 1 3 5 5 3 4 5 5 4 4 5 5 4 3 5 5 3 3 5 5 3 4 5 5 4 4 5 5 4 3 5 5 3 1 5 5 1 4 5 5 4 4 5 5 4 1 5 5 1",
                "1 6 6 1 5 6 6 5 5 6 6 5 1 6 6 1 4 6 6 4 5 6 6 5 5 6 6 5 4 6 6 4 4 6 6 4 5 6 6 5 5 6 6 5 4 6 6 4 1 6 6 1 5 6 6 5 5 6 6 5 1 6 6 1 3 6 6 3 5 6 6 5 5 6 6 5 3 6 6 3 4 6 6 4 5 6 6 5 5 6 6 5 4 6 6 4 4 6 6 4 5 6 6 5 5 6 6 5 4 6 6 4 3 6 6 3 5 6 6 5 5 6 6 5 3 6 6 3 3 6 6 3 5 6 6 5 5 6 6 5 3 6 6 3 4 6 6 4 5 6 6 5 5 6 6 5 4 6 6 4 4 6 6 4 5 6 6 5 5 6 6 5 4 6 6 4 3 6 6 3 5 6 6 5 5 6 6 5 3 6 6 3 1 6 6 1 5 6 6 5 5 6 6 5 1 6 6 1 4 6 6 4 5 6 6 5 5 6 6 5 4 6 6 4 4 6 6 4 5 6 6 5 5 6 6 5 4 6 6 4 1 6 6 1 5 6 6 5 5 6 6 5 1 6 6 1 2 6 6 2 5 6 6 5 5 6 6 5 2 6 6 2 4 6 6 4 5 6 6 5 5 6 6 5 4 6 6 4 4 6 6 4 5 6 6 5 5 6 6 5 4 6 6 4 2 6 6 2 5 6 6 5 5 6 6 5 2 6 6 2 3 6 6 3 5 6 6 5 5 6 6 5 3 6 6 3 4 6 6 4 5 6 6 5 5 6 6 5 4 6 6 4 4 6 6 4 5 6 6 5 5 6 6 5 4 6 6 4 3 6 6 3 5 6 6 5 5 6 6 5 3 6 6 3 3 6 6 3 5 6 6 5 5 6 6 5 3 6 6 3 4 6 6 4 5 6 6 5 5 6 6 5 4 6 6 4 4 6 6 4 5 6 6 5 5 6 6 5 4 6 6 4 3 6 6 3 5 6 6 5 5 6 6 5 3 6 6 3 2 6 6 2 5 6 6 5 5 6 6 5 2 6 6 2 4 6 6 4 5 6 6 5 5 6 6 5 4 6 6 4 4 6 6 4 5 6 6 5 5 6 6 5 4 6 6 4 2 6 6 2 5 6 6 5 5 6 6 5 2 6 6 2 2 6 6 2 5 6 6 5 5 6 6 5 2 6 6 2 4 6 6 4 5 6 6 5 5 6 6 5 4 6 6 4 4 6 6 4 5 6 6 5 5 6 6 5 4 6 6 4 2 6 6 2 5 6 6 5 5 6 6 5 2 6 6 2 3 6 6 3 5 6 6 5 5 6 6 5 3 6 6 3 4 6 6 4 5 6 6 5 5 6 6 5 4 6 6 4 4 6 6 4 5 6 6 5 5 6 6 5 4 6 6 4 3 6 6 3 5 6 6 5 5 6 6 5 3 6 6 3 3 6 6 3 5 6 6 5 5 6 6 5 3 6 6 3 4 6 6 4 5 6 6 5 5 6 6 5 4 6 6 4 4 6 6 4 5 6 6 5 5 6 6 5 4 6 6 4 3 6 6 3 5 6 6 5 5 6 6 5 3 6 6 3 2 6 6 2 5 6 6 5 5 6 6 5 2 6 6 2 4 6 6 4 5 6 6 5 5 6 6 5 4 6 6 4 4 6 6 4 5 6 6 5 5 6 6 5 4 6 6 4 2 6 6 2 5 6 6 5 5 6 6 5 2 6 6 2 1 6 6 1 5 6 6 5 5 6 6 5 1 6 6 1 4 6 6 4 5 6 6 5 5 6 6 5 4 6 6 4 4 6 6 4 5 6 6 5 5 6 6 5 4 6 6 4 1 6 6 1 5 6 6 5 5 6 6 5 1 6 6 1 3 6 6 3 5 6 6 5 5 6 6 5 3 6 6 3 4 6 6 4 5 6 6 5 5 6 6 5 4 6 6 4 4 6 6 4 5 6 6 5 5 6 6 5 4 6 6 4 3 6 6 3 5 6 6 5 5 6 6 5 3 6 6 3 3 6 6 3 5 6 6 5 5 6 6 5 3 6 6 3 4 6 6 4 5 6 6 5 5 6 6 5 4 6 6 4 4 6 6 4 5 6 6 5 5 6 6 5 4 6 6 4 3 6 6 3 5 6 6 5 5 6 6 5 3 6 6 3 1 6 6 1 5 6 6 5 5 6 6 5 1 6 6 1 4 6 6 4 5 6 6 5 5 6 6 5 4 6 6 4