                "1 7 7 1 6 7 7 6 6 7 7 6 1 7 7 1 5 7 7 5 6 7 7 6 6 7 7 6 5 7 7 5 5 7 7 5 6 7 7 6 6 7 7 6 5 7 7 5 1 7 7 1 6 7 7 6 6 7 7 6 1 7 7 1 4 7 7 4 6 7 7 6 6 7 7 6 4 7 7 4 5 7 7 5 6 7 7 6 6 7 7 6 5 7 7 5 5 7 7 5 6 7 7 6 6 7 7 6 5 7 7 5 4 7 7 4 6 7 7 6 6 7 7 6 4 7 7 4 4 7 7 4 6 7 7 6 6 7 7 6 4 7 7 4 5 7 7 5 6 7 7 6 6 7 7 6 5 7 7 5 5 7 7 5 6 7 7 6 6 7 7 6 5 7 7 5 4 7 7 4 6 7 7 6 6 7 7 6 4 7 7 4 1 7 7 1 6 7 7 6 6 7 7 6 1 7 7 1 5 7 7 5 6 7 7 6 6 7 7 6 5 7 7 5 5 7 7 5 6 7 7 6 6 7 7 6 5 7 7 5 1 7 7 1 6 7 7 6 6 7 7 6 1 7 7 1 3 7 7 3 6 7 7 6 6 7 7 6 3 7 7 3 5 7 7 5 6 7 7 6 6 7 7 6 5 7 7 5 5 7 7 5 6 7 7 6 6 7 7 6 5 7 7 5 3 7 7 3 6 7 7 6 6 7 7 6 3 7 7 3 4 7 7 4 6 7 7 6 6 7 7 6 4 7 7 4 5 7 7 5 6 7 7 6 6 7 7 6 5 7 7 5 5 7 7 5 6 7 7 6 6 7 7 6 5 7 7 5 4 7 7 4 6 7 7 6 6 7 7 6 4 7 7 4 4 7 7 4 6 7 7 6 6 7 7 6 4 7 7 4 5 7 7 5 6 7 7 6 6 7 7 6 5 7 7 5 5 7 7 5 6 7 7 6 6 7 7 6 5 7 7 5 4 7 7 4 6 7 7 6 6 7 7 6 4 7 7 4 3 7 7 3 6 7 7 6 6 7 7 6 3 7 7 3 5 7 7 5 6 7 7 6 6 7 7 6 5 7 7 5 5 7 7 5 6 7 7 6 6 7 7 6 5 7 7 5 3 7 7 3 6 7 7 6 6 7 7 6 3 7 7 3 3 7 7 3 6 7 7 6 6 7 7 6 3 7 7 3 5 7 7 5 6 7 7 6 6 7 7 6 5 7 7 5 5 7 7 5 6 7 7 6 6 7 7 6 5 7 7 5 3 7 7 3 6 7 7 6 6 7 7 6 3 7 7 3 4 7 7 4 6 7 7 6 6 7 7 6 4 7 7 4 5 7 7 5 6 7 7 6 6 7 7 6 5 7 7 5 5 7 7 5 6 7 7 6 6 7 7 6 5 7 7 5 4 7 7 4 6 7 7 6 6 7 7 6 4 7 7 4 4 7 7 4 6 7 7 6 6 7 7 6 4 7 7 4 5 7 7 5 6 7 7 6 6 7 7 6 5 7 7 5 5 7 7 5 6 7 7 6 6 7 7 6 5 7 7 5 4 7 7 4 6 7 7 6 6 7 7 6 4 7 7 4 3 7 7 3 6 7 7 6 6 7 7 6 3 7 7 3 5 7 7 5 6 7 7 6 6 7 7 6 5 7 7 5 5 7 7 5 6 7 7 6 6 7 7 6 5 7 7 5 3 7 7 3 6 7 7 6 6 7 7 6 3 7 7 3 1 7 7 1 6 7 7 6 6 7 7 6 1 7 7 1 5 7 7 5 6 7 7 6 6 7 7 6 5 7 7 5 5 7 7 5 6 7 7 6 6 7 7 6 5 7 7 5 1 7 7 1 6 7 7 6 6 7 7 6 1 7 7 1 4 7 7 4 6 7 7 6 6 7 7 6 4 7 7 4 5 7 7 5 6 7 7 6 6 7 7 6 5 7 7 5 5 7 7 5 6 7 7 6 6 7 7 6 5 7 7 5 4 7 7 4 6 7 7 6 6 7 7 6 4 7 7 4 4 7 7 4 6 7 7 6 6 7 7 6 4 7 7 4 5 7 7 5 6 7 7 6 6 7 7 6 5 7 7 5 5 7 7 5 6 7 7 6 6 7 7 6 5 7 7 5 4 7 7 4 6 7 7 6 6 7 7 6 4 7 7 4 1 7 7 1 6 7 7 6 6 7 7 6 1 7 7 1 5 7 7 5 6 7 7 6 6 7 7 6 5 7 7 5